import React from 'react'
import ContentLoader from 'react-content-loader'


const SkeletonHomeFirst = props => (
    <ContentLoader
        width={700}
        // height={800}
        viewBox="0 0 700 700"
        backgroundColor="black"

        // backgroundColor="#f3f3f3"
        foregroundColor="#ecebeb"
        {...props}
    >
        <rect x="35" y="20" rx="2" ry="2" width="370" height="370" />
        <rect x="0" y="410" rx="2" ry="2" width="200" height="20" />
        <rect x="35" y="440" rx="2" ry="2" width="50" height="20" />


        {/*<rect x="860" y="997" rx="2" ry="2" width="270" height="270" />*/}
        {/*<rect x="860" y="385" rx="2" ry="2" width="120" height="20" />*/}
        {/*<rect x="1070" y="385" rx="2" ry="2" width="50" height="20" />*/}
        {/*<rect x="860" y="420" rx="2" ry="2" width="50" height="20" />*/}



    </ContentLoader>
)

export default SkeletonHomeFirst
